import React, { Component } from 'react'
import ReactDOM from 'react-dom';
import './index.css';
import MyNav from './components/MyNav';


class Projects extends Component {
	render() {
		return (
     	 <div className="Projects">
      		<MyNav/>
      	</div>
    	);
	}
}

export default Projects;
